import React from 'react'
import './Album.css'
import { withRouter } from 'react-router-dom'
import {Row,Col, Card,List} from 'antd'
import BlogCommonBackGround from '../../components/blog/BlogCommonBackGround'
import { FetchDoGet } from '../../commons/Utils'

const getter=[16,24];
const colSpan=6;
/**
 * 我们的相册的页
 */
class Album extends React.Component{

    constructor(props){
        super(props)

        this.state={
            requestUrl:"/blog/v1/album/selectPhotos",
            photoPageInfo:{},
            photos:[]
        }
    }

    /**
     * 初始化我们的基本的数据
     */
    componentDidMount(){
        const _this=this;
        FetchDoGet(this.state.requestUrl,(response)=>{
            console.log(response)
            this.setState({
                photoPageInfo:response,
                photos:response.data
            })
        })

    }

    render(){

        return(
            <BlogCommonBackGround
            leftSpan={0}
            rightSpan={24}
            extra={
                <div>
                    <List
                        grid={{ gutter: 16, column: 4 }}
                        dataSource={this.state.photos}
                        renderItem={item => (
                        <List.Item>
                            <Card title={item.aLocaltion}>Card content</Card>
                        </List.Item>
                        )}
                    />
                    <Row getter={getter}>
                        <Col span={colSpan}>
                            <Card
                            hoverable
                            cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}

                            >
                            <Card.Meta title="Europe Street beat" description="www.instagram.com" />
                            </Card>
                        </Col>
                    </Row>
                </div>
            }
            />
        )
    }
}

export default withRouter(Album)
